def read_f():
    with open("stat.txt") as file:
        data = file.read()
        return data

def write_f(val):
    with open("stat.txt", "w") as f:
        f.write(val) 

for cat_url in cat_urls:
    page=0
    
    while 1:
        stat = read_f()
        if page >=60:
            page=0
            write_f('nc')
            print('page > 60 next cat')
        if stat == 'np':
            page += 1
            param="?SortType=total_tranpro_desc&g=y&isFavorite=y&page={}".format(page)
            url = cat_url + param
            print('page: ', page, 'idx', cat_url)
            write_f('w')
            webbrowser.open(url)
        if stat == 'w':
            time.sleep(.01)
        if stat == 'nc':
            write_f('np')
            print('next cat')
            idx = cat_urls.index(cat_url)
            print(len(cat_urls)-idx,' Cats Remaining')
            break
